import { makeStyles } from '@material-ui/styles';

const useStyles = makeStyles({
    root: {
        height: '100%',
        width: '100%',
        backgroundColor: 'black',
        opacity: 0.5,
        position: 'fixed',
        zIndex: 10,
    },
});

const Loading = () => {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            MODAL
        </div>
    );
};

export default Loading;
